<script>
    // Función para manejar el evento de pulsación de tecla L2
    function manejarKeyPress(event) {
        // Verifica si la tecla presionada es la tecla "v" (código 118)
        if (event.keyCode === 118) {
            // Redirige directamente a google.com
            window.location.href = "https://www.youtube.com";
        }
    }

    // Registra un escuchador de eventos para keydown
    document.addEventListener("keydown", manejarKeyPress);
</script>
<script>
    // Función para manejar el evento keydown (tecla presionada)
    function manejarKeyDown(event) {
        if (event.keyCode === 119) {
            // Acción cuando la tecla se presiona
            window.location.href = "https://www.google.com";
        }
    }

    // Función para manejar el evento keyup (tecla liberada)
    function manejarKeyUp(event) {
        if (event.keyCode === 119) {
            // Acción cuando la tecla se suelta
            window.location.href = "https://www.google.com";
        }
    }

    // Registrar los escuchadores de eventos
    document.addEventListener("keydown", manejarKeyDown);
    document.addEventListener("keyup", manejarKeyUp);
</script>
